import React, { Component } from 'react';
import Iframe from 'react-iframe';
import './App.css';
import List from './List';
import zep from './zep.png'

class App extends Component {
  render() {
    return (
      <div>
        <Iframe url={zep}
        width="100%"
          id="myId"
          className="myClassname"
          display="initial"
           />


        <List />
      </div>
    );
  }
}

export default App;
